import React from "react";
import { Nav, NavDropdown } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
        <Nav id="navigation" className="navbar navbar-inverse menu-background sht-navbar">
            <NavDropdown title="Dropdown" id="nav-dropdown">
                <NavDropdown.MenuItem eventKey="4.1">Action</NavDropdown.MenuItem >
                <NavDropdown.MenuItem eventKey="4.2">Separated link</NavDropdown.MenuItem >
            </NavDropdown>
        </Nav>
    )
  }
} 

export default CommunicatorNavigation;
